We can use the double angle formula for cosine to express $\cos (2\alpha + 2\beta)$ in terms of $\cos \alpha$ and $\sin \beta$.
\begin{align*}
\cos (2\alpha + 2\beta) &= 2\cos^2 (\alpha + \beta) - 1 \\
&= 2(\cos \alpha \cos \beta - \sin \alpha \sin \beta)^2 - 1 \\
&= 2\left(\frac{1}{3}\right)^2 - 1 \\
&= 2\left(\frac{1}{9}\right) - 1 \\
&= \frac{2}{9} - 1 \\
&= \boxed{-\frac{7}{9}}.
\end{align*}
The answer is: -\frac{7}{9}

We can use the double angle formula for tangent, which states that $\tan 2\alpha = \frac{2\tan\alpha}{1-\tan^2\alpha}$.
Substituting $\tan\alpha=3$, we have $\tan 2\alpha = \frac{2(3)}{1-3^2} = \frac{6}{1-9} = \frac{6}{-8} = \boxed{-\frac{3}{4}}$.
The answer is: -\frac{3}{4}

